use hyperlane::*;

async fn hello_world(ctx: Context) {
    ctx.send_response(200, "Hello, World!").await.unwrap();
}

#[tokio::main]
async fn main() {
    let server: Server = Server::new();
    server.route("/", hello_world).await;
    server.run().await.unwrap();
}

